import { useState } from 'react';
function Email({ To, setTo }) {
  return (
    <>
      <div>{To}</div>
      <div>
        Content: <input type='textarea'></input>
      </div>
      <button
        onClick={() => {
          setTo('lee');
        }}>
          Change Name
        </button>
    </>
  );
}

export default Email;
